import React from "react";
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Login from "./auth/Login";

function Body() {
    return (
        <section>
            <Routes>
                <Route path='/login' element={<Login />} exact />
            </Routes>
        </section>        
    )
}

export default Body;
